import React from "react";
import womanIllustration from "../../assets/Illustration.png";
import { Button, Typography } from "@mui/material";
import { ReactComponent as UploadIcon } from "../../assets/upload_icon.svg";
import { orange } from "@mui/material/colors";

const ImportComponent = () => {
  return (
    <div className="w-full flex p-12 items-center">
      <div className="w-1/2 flex flex-col items-center gap-12">
        <Typography variant="h4">
          Import your <br /> transaction file with <br /> a few clicks
        </Typography>
        <Typography variant="h6">Upload is made easy for you.</Typography>
        <Button
          variant="contained"
          style={{
            background: orange[800],
            borderRadius: 25,
            width: 175,
            gap: 5,
            alignItems: "center",
            display: "flex",
            flexDirection: "row",
          }}
        >
          <UploadIcon style={{ width: 25, fill: "white" }} />
          <Typography variant="h6" color="white">
            Import
          </Typography>
        </Button>
      </div>
      <div className="w-1/2">
        <img src={womanIllustration} alt="woman with a computer" />
      </div>
    </div>
  );
};

export default ImportComponent;
